import React from 'react';
import { Link } from "react-router-dom";
export const Navbar = () => {
  return (
    <div>
        <nav>
        <Link to="/">Home</Link>&nbsp;&nbsp;&nbsp;&nbsp;
        <Link to="/my-todo-list">My Todo List</Link>&nbsp;&nbsp;&nbsp;&nbsp;
        <Link to="/about">About</Link>
        </nav>
    </div>
    
  )
}
